pragma solidity ^0.5.0;

contract DriverInformation {
   string driverid;
   string driverName;
   string age;
   string dob;
   string city;
   string zip;

function setDriverInformation(string memory _driverid, string memory _driverName, string memory _age, string memory _dob, string memory _city, string memory _zip) public {
      driverid = _driverid;
      driverName= _driverName;
      age = _age;
      dob = _dob;
      city = _city;
      zip = _zip;

   }

   function getDIRenewalChange() public view returns (string memory ,string memory ,string memory ,string memory ,string memory ,string memory ) {
       return ( driverid,driverName,age,dob,city,zip);

   }

}
